import utils from "./utils";

const KEY_PERSIST_STORE = 'react-app-template-v16';
const API_URL = process.env.REACT_APP_API_URL;
const BASE_PATH =  process.env.REACT_APP_BASE_PATH;


export default {
    KEY_PERSIST_STORE,
    API_URL,
    BASE_PATH,
    utils
}

export {
    KEY_PERSIST_STORE,
    API_URL,
    BASE_PATH,
    utils
}
